{c_highlight}Etkin:{/c} Diğer platformlardaki oyuncularla karşılaşabilir ve birlikte oynayabilirsin.
{c_highlight}Devre Dışı:{/c} Diğer platformlardaki oyuncularla karşılaşamaz veya birlikte oynayamazsın.

{c_highlight}Yalnızca karakter seçme ekranındayken değiştirilebilir. {/c}

Etkin ses kanallarında konuşmadan metne transkripsiyonu etkinleştirir.

Daha fazla bilgi almak için {c_highlight}https://blizzard.com/legal/{/c} adresindeki Çevrimiçi Gizlilik Politikamızı görüntüle.

{c_highlight}Yalnızca İngilizce konuşma sesini destekler.{/c}

Kişisel bilgilerinizin paylaşılmasına veya satılmasına izin vermek istemiyorsanız bu seçeneği etkinleştirin.

Gizlilik yasaları, bazı eyalet sakinlerine kişisel bilgilerin satışını veya paylaşımını devre dışı bırakma hakkı verir. Bu, bu üçüncü taraf platformlardaki reklamları size özel kişiselleştirmek için tercihlerinizin veya ilgi alanlarınızın tahmin edilmesi amacıyla verilerin üçüncü taraflara aktarılmasını ve paylaşılmasını kapsayacak şekilde tanımlanır. Bu seçeneği seçerek Blizzard'ın kişisel bilgilerinizi "satış" veya "paylaşma" olarak değerlendirilebilecek amaçlarla açıklamasını devre dışı bırakırsanız pazarlama ortaklarımız da dâhil olmak üzere bu oyunda ve Blizzard hesabınız için toplanan kişisel bilgilerinizi satmayacağız (gelecekte böyle yaparsak) veya paylaşmayacağız. 

Blizzard'ın hangi kişisel bilgileri topladığı ve bu bilgilerle ilgili haklarınız hakkında bilgi almak için Gizlilik Politikamızı inceleyin: {c_highlight}https://blizzard.com/legal/{/c}
